import React from "react";
import Row from "../Row/Row";
import Card from "../Card/Card";

export default function Books() {
  return (
    <div className="book-container">
      Hello
      {myLibrary.map((book) => {
        return <Row book={book} />;
      })}
    </div>
  );
}
